import React, { useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "./catSwiper.scss";
import '../../../node_modules/swiper/swiper.scss';
import { EffectCards, Pagination, Navigation } from "swiper";
import "swiper/css/navigation";


export default function catSwiper() {
    return (
        <div>
            <Swiper
                pagination={{
                    type: "fraction"
                }}
                navigation={true}
                effect={"cards"}
                grabCursor={true}
                modules={[EffectCards, Pagination, Navigation]}
                className="mySwiper"
            >
                <SwiperSlide>Slide 1</SwiperSlide>
                <SwiperSlide>Slide 2</SwiperSlide>
                <SwiperSlide>Slide 3</SwiperSlide>
                <SwiperSlide>Slide 4</SwiperSlide>
                <SwiperSlide>Slide 5</SwiperSlide>
                <SwiperSlide>Slide 6</SwiperSlide>
                <SwiperSlide>Slide 7</SwiperSlide>
                <SwiperSlide>Slide 8</SwiperSlide>
                <SwiperSlide>Slide 9</SwiperSlide>
                <SwiperSlide>Slide 10</SwiperSlide>
                <SwiperSlide>Slide 11</SwiperSlide>
                <SwiperSlide>Slide 12</SwiperSlide>
                <SwiperSlide>Slide 13</SwiperSlide>
                <SwiperSlide>Slide 14</SwiperSlide>
                <SwiperSlide>Slide 15</SwiperSlide>
                <SwiperSlide>Slide 16</SwiperSlide>
                <SwiperSlide>Slide 17</SwiperSlide>
                <SwiperSlide>Slide 17</SwiperSlide>
                <SwiperSlide>Slide 17</SwiperSlide>
                <SwiperSlide>Slide 17</SwiperSlide>
                <SwiperSlide>Slide 17</SwiperSlide>
                <SwiperSlide>Slide 17</SwiperSlide>
                <SwiperSlide>Slide 17</SwiperSlide>
            </Swiper>
        </div>
    );
}
